                </View>
                <View style={{height:"100%",width:"35%", justifyContent:'flex-start', alignItems:'center', backgroundColor:"green"}}>
                    <Octicons name="list-unordered" size={60} color="black" />
                </View>
                <View style={{height:"100%",width:"35%", justifyContent:'flex-start', alignItems:'center', backgroundColor:"green"}}>
                    <MaterialCommunityIcons name="table-furniture" size={60} color="white" />
                </View>


        </View>

        )
}

export default Tabs;
